import React, { useEffect } from 'react';
import s from './Card.module.css';
import { useHistory } from 'react-router-dom';



export default function Card({name}) {

    return (
        <div  className={s.container}>
            <p className={s.name} >{name}</p>
        </div>
      )
    };
